import React from 'react'
import {Row, Col, Container } from 'react-bootstrap'


export const Head = () => {
    return (
        <Container className='headerContainer' >
            <Row className="justify-content-md-center">
                <Col sm={12} md={6}>
                    <span className="logoDps">
                        <img src="https://res.cloudinary.com/dtiqybyoh/image/upload/v1626376903/page/thumbnail_logo_DPS_1d534fe27e_qhvffe.png"  alt="" />
                    </span>
                </Col>
                <Col sm={{ span: 2, offset: 2 }} className="d-sm-none d-md-block">
                    <span className="logoUnidos">
                        <img src="https://res.cloudinary.com/dtiqybyoh/image/upload/v1626376904/page/logo_Unidos_8e759746da_d7gxz7.png" alt="" />
                    </span>
                    <p>Estamos con las familias más vulnerables de Colombia<br />
                    <a href="https://prosperidadsocial.gov.co/" rel="noreferrer" target='_blank'>Prosperidad Social</a>.</p>
                </Col>
            </Row>
        </Container>
    )
}

